INSERT INTO `tblstatements` (`history`, `mission`, `vision`, `corevalues`) VALUES
('\r\nIn 1999, the Archdiocese of Lipa, under the guidance of Archbishop Guadencio B. Rosales, began sending to Rome student priests to do post-graduate studies in Theology, Scriptures, Canon Law and History, preparatory to the re-founding of the St. Francis de Sales Theological Seminary. \r\n\r\nAfter much discussion, the Lipa Archdiocesan Formation Center(LAFORCE) building was chosen to be the temporary residence of the Theological seminary. As all these were happening, the Archbishop Rosales had \r\nbegun monthly meetings with senior college seminarians  in order to orient and prepare them to the kind of formation that this seminary would try to imbibe. On April 8, 2003, Archbishop Rosales announced his choice of Rev. Fr. Exequiel M. Dimaculangan as the first rector of the seminary. \r\n\r\nThe Holy Spirit Mass on July 9, 2003 formally opened the Theological seminary and signaled the official recognition of SFSTS by the whole Archdiocese.\r\n\r\nOn September 15, 2003, the appointment of Archbishop Rosales as the new Archbishop of Manila was formally announced to the whole church. It meant that he was leaving the Archdiocese of Lipa, and the new seminary in particular. \r\n\r\nFortunately for this young seminary, he left a valuable and indispensible aid for priestly formation, that is, the Regula Vitae (Rule of Life), which he personally shaped. The Regula Vitae identified Spiritually as the Matrix of Formation and accentiated the need for priestly conscience.\r\n\r\nBy the coming of the new shepard of the Archdiocese of Lipa, Most Rev. Ramon C. Argieles, D.D., Rev. Fr. Angel Marcelo M Pastor as stalled as the second rector of the seminary on the 23rd of November 2004.\r\n\r\nAside from the Rule of Life, the priest-formators, in consultation with the seminarians carried the house rules and the functions of the various committees. The seminarians, on the other hand, took the initiative to formulate the Constitution and By-laws of the Seminarians Executive Council. The seminary also tried to enunciate its Vision and Mission both as a formation house and as an academic institution. But the most essential aspect of formation relies on the openness and obedience to the workings of the Holy Spirit Who is the Main Protagonist in priestly formation. By the grace of God, the first ordinations to the Sacred Priesthood from St. Francis de Sales\r\nTheologate were administered by Archbishop Arguelles in 2008.\r\n\r\nOn August 18, 2009, Archbishop Arguelles officially installed Rev. Fr. Marcelino Antonio M. Wamil Jr. as the third rector of the Theologate Seminary.\r\n\r\nIn May 2011, St. Francis de Sales Theological Seminary pioneered a trimestral seminary formation model. This aims to advance the holistic development of seminarians by providing a more obligative human, intellectual, spiritual and pastoral learning experience.\r\n\r\nBy September 26, 2012, the SFSTS community transferred from their temporary residence in LAFORCE to their newly constructed\r\nformation building also within the SFS Seminary Compound in Maraouy, Lipa City.\r\n\r\nOn January 24, 2013, on the feast day of the seminary patron saint-St. Francis de Sales, Archbishop Arguelles installed Rev. Fr. Angel Marcelo M. Pastor again as Rector of the seminary.\r\n\r\nIn the presence of the other bishops, priests, and the whole People of God, St. Francis de Sales Theological Seminary Main Building and the St. Francis de Sales Theological Seminary Main Chapel was blessed by His Eminence Luis Antonio G. Cardinal Tagle, Archbishop of Manila on the eight day of September, the Feast of the Nativity of the Virgin Mary in the year of the Lord, two thousand and fourteen.    \r\n\r\n\r\n\r\n', 'We are committed to provide priests who are intimately related to God and in communion with the people, imbued with human and Christian virtues motivated by priestly conscience equipped with sound knowledge in ecclesiastical science and are gentle but firm sheperds like St. Francis de Sales through a responsible holistic formation in an atmosphere of life-witnessing.', 'A community called by God to be seedbed of priestly vocation witnessing to the evangelical spirit in the service of sanctification of the people of God.', '1. Servant- leadership\r\n2. Love for the Church\r\n3. Passion for Evangelization\r\n4. Firmness and Gentleness like\r\nthat of St. Francis de Sales');

